import {BrowserRouter,Routes,Route} from "react-router-dom"
import {Cart,CategoryProduct,Home,ProductSingle,Search} from "./Pages/index";
import Header from "./components";
import {Footer} from "./components/Footer/Footer";
function App() {
  return (
   <BrowserRouter>
   <Header/>
   <Routes>
     <Route path="/"></Route>
   </Routes>
   <Footer/>
   </BrowserRouter>
  );
}

export default App;
